import React, { Component } from "react";
import Department from "./Department";
import axios from "axios";

export class Departments extends Component {
  componentDidMount() {
    axios
      .get("http://localhost:8080/api/department")
      .then(res => {
        console.log(res);
      })
      .catch(err => {
        console.error(err);
      });
  }

  render() {
    return (
      <div>
        <Department />
      </div>
    );
  }
}

export default Departments;
